			shellScript = "echo \"CODESIGNING_FOLDER_PATH = $CODESIGNING_FOLDER_PATH\"\necho \"EXECUTABLE_NAME = $EXECUTABLE_NAME\"\n\n# locate the provisioning tool folder\nif [ -d ${SRCROOT}/../../CloakwareStreaming/provision ]; then\n  PLAYREADY_DIST_DIR=${SRCROOT}/../..\n  PROVISIONING_DIR=${PLAYREADY_DIST_DIR}/CloakwareStreaming/provision\nelse\n\techo \"Error: failed to locate the provisioning folder!\"\n\texit 1\nfi\n \n# always do provisioning for Robust builds.\nif [ ${CONFIGURATION} == ${CONFIGURATION} ]\nthen\n\n  # export PLAYREADY_DIST_DIR to shell scripts \n  declare -x PLAYREADY_DIST_DIR=${PLAYREADY_DIST_DIR}\n\n  if [ ${PLATFORM_NAME} == \"iphonesimulator\" ]; then\n    TARGET_OS=\"ios-simulator\"\n    TARGET_ARCH=\"i386\"\n  elif [ ${PLATFORM_NAME} == \"iphoneos\" ]; then\n    TARGET_OS=\"ios\"\n    TARGET_ARCH=\"fat\"\n  else \n    echo \"Error: unsupported PLATFORM_NAME = ${PLATFORM_NAME}! Can't continue the provisioning.\"\n    exit 2\n  fi\n\n  declare -x EXPORTED_RANDOMSEED=\"$(cat ${PLAYREADY_DIST_DIR}/CloakwareStreaming/bin/internal/css/dat/RandomSeed)\"\n  echo \"EXPORTED_RANDOMSEED = ${EXPORTED_RANDOMSEED}\"\n\n  echo \"PLAYREADY_DIST_DIR = ${PLAYREADY_DIST_DIR}\"\n  echo \"PROVISIONING_DIR = ${PROVISIONING_DIR}\"\n  echo \"TARGET_OS is $TARGET_OS\"\n  echo \"TARGET_ARCH is $TARGET_ARCH\"\n\n  # save the current dir\n  pushd $(pwd)\n\n  # perform provisioning process now\n  cd $PROVISIONING_DIR\n  echo \"Creating Key Store\"\n  ./createKeyStore.sh $TARGET_OS $TARGET_ARCH\n  if [ $? -gt 0 ]; then\n\texit 1\n  fi\n\n  cp -f data/irss.dat $CODESIGNING_FOLDER_PATH/data/irss.dat\n  cp -f data/irss3.dat $CODESIGNING_FOLDER_PATH/data/irss3.dat\n\n  echo \"Creating Application Context Voucher using createACV.sh\"\n  echo \"./createACV.sh $CODESIGNING_FOLDER_PATH $EXECUTABLE_NAME $TARGET_OS $TARGET_ARCH\" \n  ./createACV.sh $CODESIGNING_FOLDER_PATH $EXECUTABLE_NAME $TARGET_OS $TARGET_ARCH\n  if [ $? -gt 0 ]; then\n\texit 1\n  fi\n\n  # cd to original dir\n  popd\n\n# Provisioning for non-Robust builds...\nelse\n\n# simply copy raw security data files to 'data'\ncp -f $PROVISIONING_DIR/data/* $CODESIGNING_FOLDER_PATH/data/.\n\nfi\n";
